import 'bootstrap/dist/css/bootstrap.min.css';
import logoGeo from '../assets/img/logo/geo-logo.svg'
function HeaderFDI() {
  return (
    <div>
    <div class="row d-flex justify-content-around height: 108px; text-white bg-dark">
    <div class="col-1 ">
    <img src={logoGeo } class="img-fluid img-thumbnai" alt="..." />
    </div>
    <div class="col-2">
      2 of 3 (wider)
    </div>
    <div class="col-1">
      3 of 3
    </div>
  </div>
    </div>
  );
}
export default HeaderFDI;
